import React, { Fragment } from 'react'

const Register = () => {
  return (
    <Fragment className='flex justify-center align-middle'>
        <form className='w-[500px] h-[500px] border-black'>
            <div>
                <label htmlFor="uname">Name</label>
                
            </div>
        </form>
    </Fragment>
  )
}

export default Register
